import './App.css'
import photo from './photo.jpg';

function About(){
    
    const names = ["Ashmitha Pais", "Steve Betts", "Preet Dhaliwal", "Chris Farnsworth", "Abdul Barrie", "Nathan Loo"];
    const members = [];

    for(let i = 0; i < 6; i++){
        members.push(
            <div class="member">
                <img class="memberphoto" src={photo} alt=""/>
                <p class="membertitle"> {names[i]} </p>
            </div>
        );
        
    }
    return members;
}
export default About;
